# Prefix: Languagesystems
# automatic
languagesystem DFLT dflt;

languagesystem latn dflt;
languagesystem latn AZE;
languagesystem latn CRT;
languagesystem latn KAZ;
languagesystem latn TAT;
languagesystem latn TRK;
languagesystem latn ROM;
languagesystem latn MOL;


feature aalt {
# automatic
feature locl;
feature subs;
feature sinf;
feature sups;
feature numr;
feature dnom;
feature frac;
feature calt;
feature ordn;

} aalt;

feature ccmp {
lookup ccmp_soft_dotted {
	@CombiningTopAccents = [acutecomb brevecomb candraBinducomb caroncomb circumflexcomb commaabovecomb commareversedabovecomb commaturnedabovecomb dblverticallineabovecomb dieresiscomb dotaccentcomb gravecomb hungarumlautcomb macroncomb ringcomb tildecomb verticallineabovecomb overlinecomb];
	@CombiningNonTopAccents = [acutebelowcomb brevebelowcomb cedillacomb circumflexbelowcomb commaaccentcomb dieresisbelowcomb dotbelowcomb gravebelowcomb macronbelowcomb ogonekcomb ringbelowcomb slashlongcomb slashshortcomb strokelongcomb strokeshortcomb];
	sub [i j]' @CombiningTopAccents by [idotless jdotless];
	sub [i j]' @CombiningNonTopAccents @CombiningTopAccents by [idotless jdotless];
	sub [iogonek]' @CombiningTopAccents by [idotlessogonek];
	sub [iogonek]' @CombiningNonTopAccents @CombiningTopAccents by [idotlessogonek];
} ccmp_soft_dotted;

} ccmp;

feature locl {
# automatic
lookup locl_latn_0 {
	script latn;
	language AZE;
	sub i by idotaccent;
	language CRT;
	sub i by idotaccent;
	language KAZ;
	sub i by idotaccent;
	language TAT;
	sub i by idotaccent;
	language TRK;
	sub i by idotaccent;
} locl_latn_0;

lookup locl_latn_1 {
	script latn;
	language ROM;
	sub Scedilla by Scommaaccent;
	sub scedilla by scommaaccent;
	language MOL;
	sub Scedilla by Scommaaccent;
	sub scedilla by scommaaccent;
} locl_latn_1;

} locl;

