feature frac {
# automatic
lookup FRAC {
	sub slash by fraction;
} FRAC;
lookup UP {
	sub [zero one two three four five six seven eight nine] by [zero.numr one.numr two.numr three.numr four.numr five.numr six.numr seven.numr eight.numr nine.numr];
} UP;
lookup DOWN {
	sub fraction [zero.numr one.numr two.numr three.numr four.numr five.numr six.numr seven.numr eight.numr nine.numr]' by [zero.dnom one.dnom two.dnom three.dnom four.dnom five.dnom six.dnom seven.dnom eight.dnom nine.dnom];
	sub [zero.dnom one.dnom two.dnom three.dnom four.dnom five.dnom six.dnom seven.dnom eight.dnom nine.dnom] [zero.numr one.numr two.numr three.numr four.numr five.numr six.numr seven.numr eight.numr nine.numr]' by [zero.dnom one.dnom two.dnom three.dnom four.dnom five.dnom six.dnom seven.dnom eight.dnom nine.dnom];
} DOWN;

} frac;

feature calt {
lookup www_liga {
	ignore sub w w' w @LETTER;
	ignore sub w' w w @LETTER;
	sub liga.spacer liga.spacer w' by www.liga;
	sub liga.spacer w' w by liga.spacer;
	sub w' w w by liga.spacer;
} www_liga;

lookup slash_slash_liga {
	ignore sub slash slash' slash;
	ignore sub slash' slash slash;
	sub liga.spacer slash' by slash_slash.liga;
	sub slash' slash by liga.spacer;
} slash_slash_liga;

lookup backslash_backslash_liga {
	ignore sub backslash backslash' backslash;
	ignore sub backslash' backslash backslash;
	sub liga.spacer backslash' by backslash_backslash.liga;
	sub backslash' backslash by liga.spacer;
} backslash_backslash_liga;

lookup asterisk_asterisk_liga {
	ignore sub asterisk asterisk' asterisk;
	ignore sub asterisk' asterisk asterisk;
	sub liga.spacer asterisk' by asterisk_asterisk.liga;
	sub asterisk' asterisk by liga.spacer;
} asterisk_asterisk_liga;

lookup slash_equal_liga {
	ignore sub slash' equal' equal;
	ignore sub @NON_SPACING' slash' equal;
	sub liga.spacer equal' by slash_equal.liga;
	sub slash' equal by liga.spacer;
} slash_equal_liga;

lookup slash_asterisk_liga {
	ignore sub slash' period;
	ignore sub @NON_SPACING' slash' asterisk;
	ignore sub asterisk_asterisk.liga' slash' asterisk;
	sub liga.spacer asterisk' by slash_asterisk.liga;
	sub slash' asterisk by liga.spacer;
} slash_asterisk_liga;

