	ignore sub equal' equal' greater; #escape equal_equal_greater
	ignore sub equal' equal' less; #escape equal_equal_less
	ignore sub equal equal' equal;
	ignore sub equal' equal equal;
	sub liga.spacer equal' by equal_equal.liga;
	sub equal' equal by liga.spacer;
} equal_equal_liga;

